import Switch from "react-switch";

const Switcher = ({checked, handleChange}) => {

    return (
        <label>
            <span>Switch with default style</span>
            <Switch 
                uncheckedIcon={false}
                onChange={handleChange}
                checked={checked} />
        </label>
    );
}

export default Switcher;
